import { mapGetters, mapMutations } from 'vuex'

export default {
  props: {
    direction: {
      type: String,
      default: 'horizontal'
    }
  },
  computed: {
    ...mapGetters([
      'menuMap',
      'themeColor',
      'device',
      'moduleMenuIndex'
    ])
  },
  methods: {
    clickModuleTab(index) {
      this.setModuleMenuIndex(index)
      this.$emit('currentTabIndex', index)
    },
    ...mapMutations({
      'setModuleMenuIndex': 'SET_MODULE_MENU_INDEX'
    })
  }
}
